function isEligible(age) {
  if (age < 18) {
    return false
  } else {
    return true
  }
}

test("isEligible returns correct output", () => {
  expect(isEligible(100)).toBe(true)
  expect(isEligible(22)).toBe(true)
  expect(isEligible(16)).toBe(false)
}) 
